
CREATE DATABASE IF NOT EXISTS extope_3q DEFAULT CHARSET utf8 COLLATE utf8_general_ci;
GRANT ALL ON extope_3q.* TO 'root' IDENTIFIED BY 'root';
FLUSH PRIVILEGES;
SET FOREIGN_KEY_CHECKS = 0;
USE extope_3q;
DROP TABLE IF EXISTS extope_3q.t_file_info;

CREATE TABLE extope_3q.t_file_info (
  `FILE_ID` BIGINT NOT NULL AUTO_INCREMENT COMMENT 'ファイルID',
  `INST_ID` BIGINT NOT NULL DEFAULT '8' COMMENT '装置ID',
  `FILE_NAME` VARCHAR(100) NOT NULL DEFAULT 'ファイル名称' COMMENT 'ファイル名称',
  `FILE_TYPE` INT NOT NULL DEFAULT '1' COMMENT 'ファイルタイプ',
  `FILE_SIZE` BIGINT NOT NULL DEFAULT '8' COMMENT 'ファイルサイズ',
  `DISP_NUM`  INT NOT NULL DEFAULT '0' COMMENT 'ディスプレイナンバー',
  `CREATED` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '作成タイムスタンプ',
  `UPDATED` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新タイムスタンプ',
  PRIMARY KEY (`FILE_ID`)
) ENGINE = InnoDB AUTO_INCREMENT = 1 DEFAULT CHARSET = utf8;

CREATE TABLE extope_3q.m_instrument (
  `INST_ID` BIGINT NOT NULL AUTO_INCREMENT COMMENT '装置ID',
  `INST_NAME` VARCHAR(100) NOT NULL DEFAULT '装置名称' COMMENT '装置名称',
  `DISP_NUM` INT NOT NULL DEFAULT '0' COMMENT 'ディスプレイナンバー',
  `CREATED` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '作成タイムスタンプ',
  `UPDATED` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新タイムスタンプ',
  PRIMARY KEY (`INST_ID`)
) ENGINE = InnoDB AUTO_INCREMENT = 1 DEFAULT CHARSET = utf8;

CREATE TABLE extope_3q.m_file_type (
  `FILE_TYPE` BIGINT NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `TYPE_NAME` VARCHAR(50) NOT NULL DEFAULT 'タイプ名称' COMMENT 'タイプ名称',
  `EXTEND` CHAR(5) NOT NULL DEFAULT 'jpg' COMMENT '拡張子名称',
  `DISP_NUM` INT NOT NULL DEFAULT '0' COMMENT 'ディスプレイナンバー',
  `CREATED` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '作成タイムスタンプ',
  `UPDATED` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新タイムスタンプ',
  PRIMARY KEY (`FILE_TYPE`)
) ENGINE = InnoDB AUTO_INCREMENT = 1 DEFAULT CHARSET = utf8;




